    private static Map<String, String> map = new HashMap<>();

    public static void main(String[] args) throws IOException {
        Map<String, String> fieldMap = getFieldMap();
        System.out.println(fieldMap);

    }

    public static Map<String, String> getFieldMap() {
        try {
            String text = FileUtils.readFileToString(new File("basic/src/main/resources/source"), "UTF-8");
            String[] lines = text.split("\r\n");

            for (String line : lines) {
                printTableInfo(line);
            }
        } catch (IOException e) {
            e.printStackTrace();
        }
        return map;
    }

    public static void printTableInfo(String str) {

        JSONObject json = JSONObject.parseObject(str);
        JSONObject info = json.getJSONObject("data").getJSONObject("baseInfo");
//        System.out.println(info.getString("name") +"="+ info.getString("alias"));
        JSONArray outputParameter = json.getJSONObject("data").getJSONObject("resultContent").getJSONArray("outputParameter");

        for (Object item : outputParameter) {
            JSONObject param = (JSONObject)item;
//            System.out.println(param.getString("fieldName") + "=" + param.getString("fieldChineseName"));
            map.put(info.getString("name") +"."+param.getString("fieldName"), param.getString("fieldChineseName"));
        }
//        System.out.println();

    }
